import Image from 'react-bootstrap/Image';
import headshot from '../../images/headshot-min.jpg';

function MiddleNav() {
  return (
    <div className="text-center" style={{ backgroundColor: '#007b70', paddingBottom: '1.5rem' }}>
      <Image
        roundedCircle
        thumbnail
        className="headshot rounded-circle"
        src={headshot}
        alt="Jeff Berlin headshot"
        title="Jeff Berlin headshot"
      />
    </div>
  );
}

export default MiddleNav;
